public class Account implements Comparable<Account> {    private int accountNUmber;    private double balance;    private double interestRate;    private double maxOverdraft;    public Account(int accountNUmber) {        this.accountNUmber = accountNUmber;    }    public Account(int accountNUmber, double balance, double interestRate, double maxOverdraft) {        this.accountNUmber = accountNUmber;        this.balance = balance;        this.interestRate = interestRate;        this.maxOverdraft = maxOverdraft;    }    @Override    public int compareTo(Account o) {        return 0;    }    public int getAccountNUmber() {        return accountNUmber;    }    public double getBalance() {        return balance;    }    public double getInterestRate() {        return interestRate;    }    public double getMaxOverdraft() {        return maxOverdraft;    }}